package criminalLaw

import (
	"errors"
	"github.com/Darklabel91/Penal/csvCriminal"
)

type Laws struct {
	Law      string
	Nickname string
}

type LawArticles struct {
	Law        Laws
	Article    string
	Definition string
}

//fetchLegislation fetch the legislation information from a given key:
//  -key format: article_lawName
func fetchLegislation(articleUnderlineLawName string) (csvCriminal.LawAnalysis, error) {
	laws, ok := mapLaws[articleUnderlineLawName]
	if !ok {
		return csvCriminal.LawAnalysis{}, errors.New("this article is not on our list and can not be fetched")
	}

	return csvCriminal.LawAnalysis{
		LawArticle:    laws.Article,
		Law:           laws.Law.Law,
		LawNickname:   laws.Law.Nickname,
		LawDefinition: laws.Definition,
	}, nil
}

